        _address: 0xAb8483F64d9C6d1EcF9b849Ae677dD3315835cb2,
        _amount: 50
    });

    Account public _acc2 = Account({
        _address: msg.sender,
        _amount: 100
    });

    function addAmount(uint _addMoney) public {
        _acc1._amount += _addMoney;
    }

    
}

